import { AspectRatio } from '@chakra-ui/react';
import { ReactElement } from 'react';

import MainBg from './Bg.mp4';

export function BackgroundImage(): ReactElement {
  return (
    <>
      <AspectRatio w="100%" height="100%" ratio={1}>
        <iframe title="naruto" src={MainBg} allowFullScreen width="100%" />
      </AspectRatio>
      {/* <video src={MainBg} loop autoPlay>
        <source type="video/mp4" />
        <track kind="captions" src={test} lang="en" />
      </video> */}
    </>
  );
}
